## funciones


extraer_texto_parentesis <- function(vec) {
  stringr::str_extract(vec, "\\([^()]+\\)$")
}

extraer_numeros_parentesis <- function(texto) {
 texto <-  str_extract(texto, 
                           "(?<=\\()[^()]+(?=\\))") |>
    str_replace_all("[()]", "") |>
   str_extract("^[^\\.\\s-]+")
  
  return(texto)
}



contar_palabras <- function(texto) {
  stri_count_words(texto)
}

seleccionar_ultimas_n <- function(texto) {
  tryCatch({
    num_palabras <- contar_palabras(texto)
    contiene_numeros <- str_detect(texto, "\\d")  # 🔍 Detecta si hay al menos un número
    
    if (!contiene_numeros) {
      return(texto)  # 🚀 Si no hay números, devuelve el texto completo
    }
    
    n <- ifelse(num_palabras >= 6, 5, 3)  # 🔹 Define `n` según la cantidad de palabras
    
    palabras <- unlist(str_split(texto, "\\s+"))  # 🔹 Divide el texto en palabras
    
    if (length(palabras) >= n) {
      paste(tail(palabras, n), collapse = " ")  # 🔹 Toma las últimas `n` palabras
    } else {
      texto  # 🔹 Devuelve el texto original si tiene menos palabras que `n`
    }
  }, error = function(e) texto)  # 🔹 En caso de error, devuelve el texto original
}


limpiar_texto <- function(texto) {
  library(stringi)
  
  # Eliminar tildes
  texto <- stri_trans_general(texto, "Latin-ASCII")
  
  # Corrección de texto
  texto <- gsub("^[^A-Za-z]+", "", texto)
  texto <- gsub("\\s*\\(.*?\\)", " ", texto) |> str_squish()
  
  texto <- gsub("\\b(?!X\\b)[A-Z]\\b", "", texto, perl = TRUE) |> str_squish()
  #texto <- gsub("\\b[A-Z]\\b", "", texto) |> str_squish()
  #texto <- gsub("\\bUND\\b|\\b\\S*\\?\\S*\\b", "", texto) |> str_squish()
  
  ## eliminar signos "?"
  texto <- gsub("\\?", "", texto)
  
  # 7. Eliminar repeticiones de letras (más de 2 veces la misma letra)
  texto <- gsub("([A-Za-z])\\1{2,}", "\\1", texto)
  
  return(texto)
}


eliminar_repetidas <- function(texto) {
  palabras <- unlist(strsplit(texto, "\\s+"))
  palabras_min <- tolower(palabras)
  palabras_unicas <- palabras[!duplicated(palabras_min)]
  resultado <- paste(palabras_unicas, collapse = " ")
  return(resultado)
}


