## estandarizar texto

estandarizar_texto <- function(texto) {
  
  texto <- str_replace_all(texto, "(?<=\\p{L})\\.(?=\\p{L})", " ")
  
  ## comillas
  texto <- chartr("ÁÉÍÓÚÜáéíóúüñ", "AEIOUUaeiouun", texto)
  
  return(texto)
}

