# Función para encontrar la mejor coincidencia dentro del umbral

dict_path <- hunspell::dictionary("idioma/index.dic")

extraer_palabras_validas <- function(texto, idioma = dict_path) {
  # Eliminar puntuación, mantener solo letras y espacios
  texto_limpio <- gsub("[^A-Za-zÁÉÍÓÚÜÑáéíóúüñ\\s]", " ", texto)
  
  # Convertir a palabras
  palabras <- unlist(strsplit(texto_limpio, "\\s+"))
  palabras <- palabras[nchar(palabras) > 4]  # Más de 4 caracteres
  
  # Verificar con el diccionario
  es_valida <- hunspell_check(palabras, dict = hunspell::dictionary(lang = idioma))
  
  palabras[es_valida]
}


encontrar_mejor_coincidencia <- function(texto, candidatos,
                                         peso_jaccard = 0.4,
                                         peso_cosine = 0.6,
                                         umbral_similitud = 0.6) {
  # Limpiar y estandarizar
  texto <- limpiar_texto(toupper(texto))
  #candidatos <- limpiar_texto(toupper(candidatos))
  
  candidatos <- toupper(candidatos)
  
  # Calcular distancias
  dist_jaccard <- stringdist(texto, candidatos, method = "jaccard")
  dist_cosine  <- stringdist(texto, candidatos, method = "cosine")
  
  # Normalizar (por si las escalas cambian)
  dist_jaccard <- dist_jaccard / max(dist_jaccard, na.rm = TRUE)
  dist_cosine  <- dist_cosine / max(dist_cosine, na.rm = TRUE)
  
  # Calcular similitud (1 - distancia)
  sim_jaccard <- 1 - dist_jaccard
  sim_cosine  <- 1 - dist_cosine
  
  # Similitud combinada
  sim_combinada <- peso_jaccard * sim_jaccard + peso_cosine * sim_cosine
  
  # Filtrar por umbral
  if (all(sim_combinada < umbral_similitud)) return(NA)
  
  # Devolver la mejor coincidencia
  candidatos[which.max(sim_combinada)]
}

